import React from "react";
import "../../css/Main.css";
import { HeadMenu, ListPosts, Profile } from "../../__modules__";

function App() {

  window.addEventListener("hashchange", () => {
    let hash = window.location.hash;

    if (hash.startsWith("#profile")) {
      return (
        <React.Fragment>
          <HeadMenu />
          <Profile />
        </React.Fragment>
      );
    }

    if (!!hash.startsWith("#home")) {
      console.log(hash.startsWith("#home"))
      return (
        <React.Fragment>
          <HeadMenu />
          <ListPosts />
        </React.Fragment>
      );
    }
  });

  return(

    <React.Fragment>
    <HeadMenu />
    <Profile />
  </React.Fragment>
  )
}

export { App };
